		"text": "[2020 서울 인디뮤직페스타]\nDAY 1\n오늘부터 양일간 진행되는 레이블마켓에서 권순관 정규 2집 &lt;Connected&gt; Vinyl을 한정수량 판매합니다.\n⠀\n일정\n11월 6일(금) 3PM - 9PM\n11월 7일(토) 2PM - 9PM\n⠀⠀\n장소\n서울문화생활센터 서교(마포구 양화로 72 효성해링턴타워) 지하 공연장 내 엠피엠지 부스 https://t.co/cgbpbaWlwl"
