		"text": "🌛Seiryun \n\n댄스플로어 뮤직을 다루는 디제이/프로듀서이다. 파티 Junction을 기획하여 서울과 도쿄에서 진행한 바 있고 가상의 오디오비주얼 파티 Hypnosis의 기획과 디제이로 참여했다. 최근에는 다분야의 작가들이 모인 팀 호모폴리넬라에서 음악감독으로서 여러 전시에 참여하고 있다. https://t.co/u2qVwfnWht"
